export const mainBoxStyles = {
  width: '100%',
  maxWidth: '1280px',
  margin: '5% auto 0 auto',
  alignSelf: 'center',
  outline: '1px solid red',
  color: 'primary.dark',
  backgroundImage:
    'url(https://media.istockphoto.com/photos/abstract-blue-backgrounds-picture-id1206589466)',
};

export const mainHeaderStyles = {
  maxWidth: '70%',
  textTransform: 'uppercase',
};
